import React from "react";

export const New=()=>{
    return(
    <ul>
        <li>Hello</li>
        <li>sasi</li>
    </ul>
    )
}
export const Component4=()=>{
    return(
        <>
        <button type="button"
        onclick="document.getElementById('demo').innerHTML = Date()">
        Click me to display Date and Time.</button>
        
        <p id="demo"></p>
        </>
    )
}
export const Component5=()=>{
    
    return(
    <ul>
        <li>Hello</li>
        <li>sasi</li>
    </ul>
    )
}
export const Component6=()=>{
    const yet={
        border: '4px',
        borderColor: 'red',
        borderStyle: 'dashed'
    }

    const imgsty={
        width:'600px',
        height:'300px',
        borderRadius:'55px',
        boxShadow:'10px 10px 10px maroon'
    }

    const own={
        fontSize:'60px',
        fontFamily:'Monotype Corsiva'
    }
    
        
    return(
        <>
            <p style={{color:'blue',backgroundColor:'green',
        textTransform:'uppercase'}}> 
        Hello there! 
        </p>
        <hr color="blue"/>
        <p style={own}>Annamalai</p>
        <h1>Bootcamp frameworks</h1>
        <ol style={yet}>
            <li>React</li><li>Spring boot</li><li>Hibernate</li>
            <li>JUnit</li><li>Mockito</li>
            <li>Jenkins</li>
        </ol>
        
        <img style={imgsty} src="images/sasi1.jpg"/>
        </>
    )
}
